import React , {useState, useEffect} from 'react';
import axios from 'axios';

function Gallery(){

    const [artpieces, setArtpieces] = useState([])

    useEffect(()=> {
        axios.get('http://localhost:5000/artpieces/')
        .then(response => {
            setArtpieces(response.data)
            // console.log(response.data)
        })


        .catch((error) => {
          console.log(error);
        })   
    },[])

    // function allArtpieces() {
        // return artpieces.map(item => { 
        //     return <img key={item._id} src={item.uri} alt="artpiece" />
        // })  


    // } 
    const all = artpieces.map(item => { 
            return (
                <div>
                    <img key={item._id} src={item.uri} alt="artpiece" /> 
                    <p>{item.title}</p> 
                </div>)
     })


    return (
        <div>
            <h1> gallery </h1>
            <div className ="canvasImgArray">
                {all}
            </div>   
            <button onClick={() => all}> console </button>
        </div>

    )
}

export default Gallery
